import React from "react";
import "./TabProfile.css";

export default function TabProfile() {
  const handlingSubmit = (e) => {
    console.log(e.defaultPrevented);
  };
  return (
    <div className="tab-profile">
      <form onSubmit={handlingSubmit}>
        <div className="userName d-flex justify-content-between">
          <label>
            First Name{" "}
            <input
              placeholder="Label"
              className=" rounded-2 p-2 "
              type="text"
            />
          </label>

          <label>
            Last Name{" "}
            <input
              placeholder="Label"
              className=" rounded-2 p-2 "
              type="text"
            />
          </label>
        </div>

        <label>
          Heading{" "}
          <input placeholder="Label" className=" rounded-2 p-2" type="text" />
        </label>

        <div className="description">
          <label className="w-100">
            Description{" "}
            <input
              placeholder="Label"
              className=" rounded-2 p-2 pb-5"
              type="text"
            />
          </label>
        </div>
        <label className="d-block">Language</label>
        <select>
          <option></option>
        </select>
      </form>
    </div>
  );
}
